import React from 'react';
import TradingViewWidget, { Themes } from 'react-tradingview-widget';
 
const LiveCharts = () => (
  <TradingViewWidget
    symbol="NASDAQ:AAPL"
    theme={Themes.DARK}
    locale="fr"
    autosize
  />
);

export default LiveCharts;
